import React from "react";
import { connect } from "react-redux";
import "./style.css";

class Summary extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { AngularData, VueData, ReactData } = this.props.FinishEnvironmentReducer.EnvironmentResponse;
    console.log("Summary: ", this.props.FinishEnvironmentReducer.EnvironmentResponse);
    return (
      <div className="Summary-main">
        <div className="top-Summary">
          <h2 className="Summmary-heading">Summary</h2>
          <div></div>
        </div>
        <div className="Summmary-content"></div>
        {!AngularData.FormSubmit === true ? (
          <div class="card">
            <div class="container">
              <p>{AngularData.NodeName}</p>
              <p>{AngularData.NodeVersion}</p>
              <p>{AngularData.NodeVolume}</p>
            </div>
          </div>
        ) : null}
        {!FormSubmit === true ? (
          <div class="card">
            <div class="container">
              <p>{ReactData.ReactName}</p>
              <p>{ReactData.ReactVersion}</p>
              <p>{ReactData.ReactVolume}</p>
            </div>
          </div>
        ) : null}
        {!FormSubmit === true ? (
          <div class="card">
            <div class="container">
              <p>{VueData.VueName}</p>
              <p>{VueData.VueVersion}</p>
              <p>{VueData.VueVolume}</p>
            </div>
          </div>
        ) : null}

        <div className="bottom-Summary "></div>
      </div>
    );
  }
}

const mapStateToProps = state => ({
  FinishEnvironmentReducer: state.FinishEnvironmentReducer
});

const mapDispatchToProps = dispatch => {
  return {};
};
export default connect(mapStateToProps, mapDispatchToProps)(Summary);
